  [],\n\t\"title\": \"SEG-Y Formatted Seismic-Reflection Profile Data Collected in
  the Potomac River/Chesapeake Bay from Sept. 6, 2006 to Sept. 8, 2006\",\n\t\"tracking_summary\":
  {\n\t\t\"total\": 9,\n\t\t\"recent\": 0\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2015-06-10T02:35:14.391596\",\n\t\"name\": \"seg-y-formatted-seismic-reflection-profile-data-collected-in-the-potomac-river-chesapeake-200685854\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"In order to test hypotheses about groundwater
  flow under and into Chesapeake Bay, geophysical surveys were conducted by U.S. Geological
  Survey (USGS) scientists on Chesapeake Bay and the Potomac River Estuary in September
  2006. Chesapeake Bay resource managers are concerned about nutrients that are entering
  the estuary via submarine groundwater discharge, which are contributing to eutrophication.
  The USGS has performed many related studies in recent years to provide managers
  with information necessary to make informed decisions about this issue. The research
  carried out as part of the study described here was designed to help refine nutrient
  budgets for Chesapeake Bay by characterizing submarine groundwater flow and discharge
  of groundwater beneath part of the mainstem and a major tributary, the Potomac River
  Estuary. For more information on the seismic surveys see http://woodshole.er.usgs.gov/operations/ia/public_ds_info.php?fa=2006-018-FA
  These data are also available via GeoMapApp (http://www.geomapapp.org/) and Virtual
  Ocean ( http://www.virtualocean.org/) earth science exploration and visualization
  applications.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\": \"bbox-east-long\",\n\t\t\"value\":
